import React from "react";
import NavigationBar from "../com/commons/NavigationBar";

const SocialMedia = ({ icon }) => {
  return (
    <div>
      <img src={icon} />
    </div>
  );
};

const Home = () => {
  let ac = localStorage.getItem("account");
  let account = JSON.parse(ac);

  return (
    <>
      <div className="HomeContainer">
        <div className="HomeContent">
          <NavigationBar text="Menu" />
          <div className="HomeBody">
            <h3 className="HomeGreeting"> Hola </h3>
            <label className="HomeLabel">{account.username}</label>

            <div>
              <SocialMedia />
            </div>
          </div>
          <div className="Home" />
        </div>
      </div>
    </>
  );
};

export default Home;
